	private static string GetTocPageTytle(TocPageType pageType)
	{
		if (pageType == TocPageType.Theory)
			return "Теория";
		if (pageType == TocPageType.Exercise)
			return "Задача";
		if (pageType == TocPageType.Quiz)
			return "Тест";
		return "";
	}


